let peer;

export const connectWithPeer = () => {
    peer = new window.Peer(undefined, {
        path: '/peerjs',
        host: '/',
        port: '5000'
    });

    peer.on('open', (id) => {
        console.log(`Succesfully connected with peer server with id: ${id}`);
    })
};

export default connectWithPeer;
